interface User {
    id: number;
    name: string;
    age: number;
}
interface Admin { level: number; permission: string[] }

interface Post {title: string; content: string}

interface Comment {
    id: number;
    author: string;
}

type UserRole = User | Admin;
type Content = Post | Comment;
type Result<T> = T | Error;
type ID = string | number;
type Status = 'pending' | 'success' | 'error';

class Response<T> {
  data: T | Error;
  status: number;

  constructor(data: T | Error, status: number) {
    this.data = data;
    this.status = status;
  }
}

class DataProcessor<T extends Content> {
  private items: (T | string)[] = [];

  addItem(item: T | null) {
    this.items.push(item);
  }

  getFirstItem(): T | undefined {
    return this.items[0];
  }

  getItems(): T | undefined {
    return this.items;
  }
}

function merge<T extends string | number>(a: T, b: T): T {
  return (typeof a === 'string' ? a + b : a) as T;
}

function wrap<T>(input: T): T[] {
  return [input]
}

class Cache<T> {
  private store = new Map<string, T>();

  get(key: string): T | undefined {
    return this.store.get(key);
  }

  set(key: string, value: T) {
    this.store.set(key, value);
  }
}

function demo() {
  const userRes = new Response<User>(new User(1, 'John', 30), 200);

  const processor = new DataProcessor<Post>();
  processor.addItem(new Post('Hello', 'World'));

  const merged = merge<string>('Hello', 'World');
  const numbers = merge<number>(1, 2);

  const cache = new Cache<ID>();
  cache.set('user1', '123');

}

